import React from 'react';
import './App.css';
import Video from "./Video/bgvideo.mp4";

function App() {
  return (
    <div className="App">
      <video
        autoPlay
        loop
        muted
        style={{
          position: "absolute",
          width: "100%",
          // left: "",
          // top: "50%",
          height: "100%",
          ojectFit: "cover",
          // transform:"translate(-50%,-50%,)",
          zIndex: "-1",
        }}
      >
        <source src={Video} type="video/mp4" />
      </video>
      <h1 className="L">LUXURY of DESIGN</h1>
      {/* <img src="image/bg1.jpg"></img> */}
    </div>
  );
}

export default App;
